import React, { useState } from 'react';

const SignUp = () => {
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();

        const userData = { userName: username, email: email, password: password};

        try {
            const response = await fetch("http://localHost:5000/api/auth/sign-up", userData);
            console.log("Sign-In successfull!", response);
        } catch (error) {
            console.error("SignUp error", error);
        }
    }

    return (
        <div>
            <p>HashtagIQ</p>
            <p>SignUp faaaaast!</p>
            <form onSubmit={handleSubmit}>
                <label htmlFor='username'>Name: </label>
                <input type='text' id='username' value={username} onChange={setUsername('')} required/>
                <label htmlFor='email'>Email: </label>
                <input type='email' id='email' value={email} onChange={setEmail('')} required/>
                <label htmlFor='password'>Password: </label>
                <input type='password' id='password' value={password} onChange={setPassword('')} required/>
                <button type='submit'>SignUp!</button>
            </form>
        </div>
    );
};

export default SignUp;
